(2, 'Avengers End Game', 'Los Vengadores restantes deben encontrar una manera de recuperar a sus aliados para un enfrentamiento epico con Thanos, el malvado que diezmo el planeta y el universo.\r\n', 2019, 1, , 'jpg');
INSERT INTO `peliculas` (`id`, `nombre`, `sinopsis`, `anio`, `generos_id`, `contenidoimagen`, `tipoimagen`) VALUES
(3, 'Toy Story 4', 'Woody siempre ha tenido claro cual es su labor en el mundo: cuidar a su dueño, ya sea Andy o Bonnie. Sin embargo, Woody descubrira lo grande que puede ser el mundo para un juguete cuando el juguete Forky se convierta en su nuevo compañero de habitacion. Los juguetes se embarcaran en una aventura que no olvidaran jamas durante un viaje por carretera.', 2019, 3, , 'jpg');
INSERT INTO `peliculas` (`id`, `nombre`, `sinopsis`, `anio`, `generos_id`, `contenidoimagen`, `tipoimagen`) VALUES
(4, 'It 2', 'En el misterioso pueblo de Derry, un malvado payaso llamado Pennywise vuelve 27 años despues para atormentar a los ya adultos miembros del Club de los Perdedores, que ahora estan mas alejados unos de otros.', 2019, 4, , 'jpg');
INSERT INTO `peliculas` (`id`, `nombre`, `sinopsis`, `anio`, `generos_id`, `contenidoimagen`, `tipoimagen`) VALUES
(5, 'Terminator 2', 'Dos androides del futuro intentan apoderarse de un adolescente que se convertira en el salvador de la Tierra.', 1991, 2, , 'jpg');
INSERT INTO `peliculas` (`id`, `nombre`, `sinopsis`, `anio`, `generos_id`, `contenidoimagen`, `tipoimagen`) VALUES
(6, 'Scarface', 'Un inmigrante cubano de las carceles de Fidel Castro provoca un camino de destruccion en su ascenso en el mundo de las drogas de Miami.', 1984, 2, , 'jpg');
INSERT INTO `peliculas` (`id`, `nombre`, `sinopsis`, `anio`, `generos_id`, `contenidoimagen`, `tipoimagen`) VALUES
(7, 'Avengers Infinity War', 'Los superheroes se alian para vencer al poderoso Thanos, el peor enemigo al que se han enfrentado. Si Thanos logra reunir las seis gemas del infinito: poder, tiempo, alma, realidad, mente y espacio, nadie podra detenerlo.', 2018, 1, , 'jpg');
INSERT INTO `peliculas` (`id`, `nombre`, `sinopsis`, `anio`, `generos_id`, `contenidoimagen`, `tipoimagen`) VALUES
(8, 'Deadpool 2', 'Deadpool debe proteger a Russell, un adolescente mutante, de Cable, un soldado del futuro geneticamente modificado. Deadpool se alia con otros superheroes para poder derrotar al poderoso Cable.', 2018, 1, , 'jpg');
INSERT INTO `peliculas` (`id`, `nombre`, `sinopsis`, `anio`, `generos_id`, `contenidoimagen`, `tipoimagen`) VALUES
(9, 'Jurassic World 2', 'Ante el peligro de un volcan que esta por hacer erupcion, Owen y Claire regresan a la isla para salvar a los dinosaurios que quedan.', 2018, 1, , 'jpg');
