(11, 'Venom', 'El periodista Eddie Brock esta investigando a Carlton Drake, el celebre fundador de Life Foundation. Brock establece una simbiosis con un ente alienigena que le ofrece superpoderes, pero el ser se apodera de su personalidad y lo vuelve perverso.', 2018, 1, , 'jpg');
INSERT INTO `peliculas` (`id`, `nombre`, `sinopsis`, `anio`, `generos_id`, `contenidoimagen`, `tipoimagen`) VALUES
(12, 'Joker', 'La pasion de Arthur Fleck, un hombre ignorado por la sociedad, es hacer reir a la gente. Sin embargo, una serie de tragicos sucesos haran que su vision del mundo se distorsione considerablemente convirtiendolo en un brillante criminal.', 2019, 5, , 'jpg');
